@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'odapas-front';
}

<div class="app-container">
  <app-header/>
  <main class="app-content">
    <router-outlet></router-outlet>
  </main>
  
  <app-footer/>
  
</div>
